function fillChart(n,t){var i=document.getElementById("myChart"),r=new Chart(i,{type:"line",data:{labels:n,datasets:[{data:t,lineTension:0,backgroundColor:"transparent",borderColor:"#007bff",borderWidth:4,pointBackgroundColor:"#007bff"}]},options:{scales:{yAxes:[{ticks:{beginAtZero:!1}}]},legend:{display:!1}}})}function getStats(n){let t=[],i=[];for(var r=0;r<60;r++)t.push(""),i.push(0);let u=$("#money");$.ajax({url:"/Dashboard/Home/GetBalanceAsync",method:"GET",async:!0,success:function(n){u.html(n+"$")},error:function(n){console.log(n.status);console.log(n.statusText)}});$.ajax({url:"/Dashboard/Home/GetLastClicksAsync",data:{linkId:n},method:"GET",success:function(n){let r=n.now;$.each(n.clicks,function(){let n=this.time,f=parseInt(r.substr(r.indexOf(":")+1,2)),e=parseInt(n.substr(n.indexOf(":")+1,2)),u=(e+(59-f))%60;t[u]=this.time;i[u]=this.count});fillChart(t,i)},error:function(n){console.log(n)}})}$(document).ready(function(){"use strict";getStats(null)}());